    false,nt"url": null,nt"notes": "This report summarizes bird banding results
    at Trustom Pond National Wildlife Refuge during the fall of 2013.  The Trustom banding
    station opened nets on 6 June and closed them on 4 August for a total of 14 days.
    We operated a total of 20 nets divided into two loops consisting of ten nets in
    the goosefields and 10 in the grasslands half of the study area. We opened ten nets
    at a time and alternated loops daily. This was the first year Monitoring & Avian
    Production Survivorship (MAPS) bird banding has been conducted to study the breeding
    season. Daily net hours and the number of open nets varied depending on weather
    conditions, but typically nets were opened 20 minutes before sunrise and closed
    around 11:00 for two days per week.  Report includes total birds captured, capture
    rates, and species totals.",nt"license_title": "License Not Specified",nt"extras":
